// src/components/DataTable.js
import React from 'react';

function DataTable({ products }) {
  return (
    <table>
      <thead>
        <tr>
          <th>Product</th>
          <th>Price</th>
          <th>Rating</th>
          <th>Configuration</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product) => (
          <tr key={product.id}>
            <td>{product.name}</td>
            <td>{product.price}</td>
            <td>{product.rating}</td>
            <td>{product.configuration}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default DataTable;
